import { useState } from 'react';
import Slidebar from "../../Components/Slidebar";
import { Link } from 'react-router-dom';
import Button from '@mui/material/Button';
import { IoIosMenu } from "react-icons/io";
import { TbGridDots } from "react-icons/tb";
import { HiViewGrid } from "react-icons/hi";
import { TfiLayoutGrid3Alt } from "react-icons/tfi";
import { FaAngleDown } from "react-icons/fa6";
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import ProductItem from "../../Components/ProductItem";

const Listing = () => {
  // State for dropdown menu
  const [anchorEl, setAnchorEl] = useState(null);
  const [selectedValue, setSelectedValue] = useState(9);
  const [itemsPerRow, setItemsPerRow] = useState(4); // Default to four items

  // Handle menu open
  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  // Handle menu close
  const handleClose = () => {
    setAnchorEl(null);
  };

  // Handle menu item selection
  const handleMenuItemClick = (value) => {
    setSelectedValue(value);
    handleClose();
  };

  // Handle grid view change
  const changeGridView = (value) => {
    setItemsPerRow(value);
  };

  // Menu open state
  const open = Boolean(anchorEl);

  return (
    <>
      <section className="product_Listing_Page">
        <div className="container">
          <div className="productListing d-flex">
            <Slidebar />
            <div className="content_right">
              <Link to="#">
                <img 
                  src="https://img.freepik.com/premium-vector/premium-gazelnut-chocolate-bar-with-sauce-pouring-down-from-top-golden-glitter-background-3d-illustration_317810-2552.jpg?w=2000" 
                  className="w-100"  
                  alt="Product"
                />
              </Link>
              <div className="showBy mt-3 mb-3 d-flex align-items-center">
                <div className="btnWrapper d-flex align-items-center">
                  <Button onClick={() => changeGridView(1)}><IoIosMenu /></Button>
                  <Button onClick={() => changeGridView(4)}><HiViewGrid /></Button>
                  <Button onClick={() => changeGridView(6)}><TbGridDots /></Button>
                  <Button onClick={() => changeGridView(9)}><TfiLayoutGrid3Alt /></Button>
                </div>
                <div className="ms-auto showByFliter">
                  <Button 
                    aria-controls={open ? 'show-menu' : undefined}
                    aria-haspopup="true"
                    aria-expanded={open ? 'true' : undefined}
                    onClick={handleClick}
                    endIcon={<FaAngleDown />}
                  >
                    Show {selectedValue}
                  </Button>
                  <Menu
                    id="show-menu"
                    anchorEl={anchorEl}
                    open={open}
                    onClose={handleClose}
                    MenuListProps={{
                      'aria-labelledby': 'show-button',
                    }}
                  >
                    <MenuItem onClick={() => handleMenuItemClick(9)}>Show 9</MenuItem>
                    <MenuItem onClick={() => handleMenuItemClick(12)}>Show 12</MenuItem>
                    <MenuItem onClick={() => handleMenuItemClick(15)}>Show 15</MenuItem>
                    <MenuItem onClick={() => handleMenuItemClick(20)}>Show 20</MenuItem>
                    <MenuItem onClick={() => handleMenuItemClick(25)}>Show 25</MenuItem>
                    <MenuItem onClick={() => handleMenuItemClick(30)}>Show 30</MenuItem>
                    <MenuItem onClick={() => handleMenuItemClick(35)}>Show 35</MenuItem>
                    <MenuItem onClick={() => handleMenuItemClick(40)}>Show 40</MenuItem>
                  </Menu>
                </div>
              </div>
              <div className="productListing" style={{ display: "grid", gridTemplateColumns: `repeat(${itemsPerRow}, 1fr)`, gap: "20px" }}>
                {[...Array(selectedValue)].map((_, index) => (
                  <ProductItem key={index} />
                ))}
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
}

export default Listing;
